import React from 'react';
import './Product.css';
function Product() {
  return <div className='product'>
      <div className='product__info'>
          <p>Info of product</p>
      </div>

      <img src='https://www.clippingpathsource.com/wp-content/uploads/2018/07/Product-Photographu-In-Black-Background.png' alt=''/>
  </div>;
}

export default Product;
